package datastructure;

public class HashElement<K,T> {
	private K key;
	private T element;
	
	public HashElement() {
		// TODO Auto-generated constructor stub
	}
	
	
	public K getKey() {
		return key;
	}
	public void setKey(K key) {
		this.key = key;
	}
	public T getElement() {
		return element;
	}
	public void setElement(T element) {
		this.element = element;
	}
	

}
